sourcesContent:
const getKeyReducer = (state = [], action) => {
  console.log('in getKeyReducer', action.payload);
  switch (action.type) {
    case 'SET_KEY':
      return action.payload;
    default:
      return state;
  }
};

export default getKeyReducer;
